				<div className="page2 page">
					<AreaPage
						header={"About me"}
						information ={"This is where i write a bit about whats inside of this site. Hope it works out :D	"}
					color="blue"/>
				</div>
				<div className="page3 page">
					<AreaPage
						header={"Resume"}
						information ={"This is where i write a bit about whats inside of this site. Hope it works out :D	"}
					color="yellow"/>
				</div>
			</div>
		);
	}
}

export default Area;
